import React from 'react';
import './Mobile.css';

function Mobile({isOpen, setOpen}) {
    return (
        <div className = "mobile">
           <div className = "close-icon" onClick = {()=> setOpen(!isOpen)}>
           <i class="fi-rr-cross-circle"></i>
           </div>

            <div className = "mobile-options">

            </div>
        </div>
    )
}

export default Mobile
